import React from "react";


const Form = () => {

    const message = "hello";

    const update = (e)=>{
        console.log(e.target.value);  
    }

    return (
        <>
            <div>
                <div id="container">
                    <h3> {message} </h3>
                    <input type="text" placeholder="Enter Your Name" onChange={update}/>
                    <button id="demo" > Submit </button>
                </div>
            </div>
        </>
    );
}


export default Form;
